import React from "react";
import "./Style.css";
const AddForm = () => {
  return (
    <div>
      <div className="formDetails">
        <form>
          <input type="text" placeholder="Enter First Name" />
          <input type="text" placeholder="Enter Last Name" />
          <input type="number" placeholder="Enter DOB" />
          <input type="submit" />
        </form>
      </div>
      <div className=""></div>
    </div>
  );
};

export default AddForm;
